function App() {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path=":movieId" element={<Movie />} />
      </Routes>
      <GlobalStyle />
    </Router>
  );
}

export default App;
